import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Image from 'react-bootstrap/Image';
import Button from 'react-bootstrap/Button';
import './App.css';

function App() {
  return (
    <Container className="mt-3">
      <Navbar>
        <Container>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="nav-custom shadow-sm mx-auto p-2 px-5 gap-5">
              <Nav.Link href="#oferty">Oferty</Nav.Link>
              <Nav.Link href="#pomoctechniczna">Pomoc techniczna</Nav.Link>
              <Nav.Link href="#oprogramowanie">Oprogramowanie</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Container className="mt-5">
        <h1 className='text-center'>Wejdź na<p>wyższy</p> level</h1>
        <div className="d-flex justify-content-center">
          <Image className="image-custom" src="słuchawki.png"></Image>
          <Image className="image-custom" src="klawiatura.png"></Image>
          <Image className="image-custom" src="mysz.png"></Image>
        </div>
      </Container>
      <Button className='button-custom px-4 shadow-sm'>Przeglądaj ofertę</Button>
    </Container>
  );
}

export default App;
